public boolean equals(Object obj) {
  if (this == obj) {
    return true;
  }

  if (obj == null) {
    return false;
  }

  if (getClass() != obj.getClass()) {
    return false;
  }

  AppPriorityACLGroup other = (AppPriorityACLGroup) obj;
  if (getMaxPriority() != other.getMaxPriority()) {
    return false;
  }

  if (getDefaultPriority() != other.getDefaultPriority()) {
    return false;
  }

  return true;
}
